import Navbar from '../../components/Common/Navbar';
import LogoutButton from '../../components/Common/LogoutButton';
import UserInfo from '../../components/Common/UserInfo';
import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';

function TestPage() {
  const [mapUrl, setMapUrl] = useState(null);
  const [robots, setRobots] = useState([]);
  const [tasks, setTasks] = useState([]);  // 작업 로그 상태 추가
  const canvasRef = useRef(null);
  const [mapResolution, setMapResolution] = useState(0.05); // 기본 값, 실제 파일에서 가져올 예정
  const [mapDimensions, setMapDimensions] = useState({ width: 0, height: 0 });

  useEffect(() => {
    fetchMonitoredMap();
    fetchMapMetadata();
    fetchRobots(); // 로봇 리스트 API 호출
    fetchAllTasks(); // 모든 작업 로그 API 호출
  }, []);

  const getToken = () => {
    const token = localStorage.getItem('token');
    if (!token) {
      alert('No token found, please log in again.');
      window.location.href = '/login'; // Redirect to login if token is missing
      return null;
    }
    return token;
  };

  const fetchMonitoredMap = async () => {
    const token = getToken();
    if (!token) return;

    try {
      const response = await axios.get('http://172.30.1.28:5557/map/monitored/file', {
        headers: { Authorization: `Bearer ${token}` },
        responseType: 'blob',
      });
      const url = URL.createObjectURL(response.data);
      setMapUrl(url);

      const img = new Image();
      img.src = url;
      img.onload = () => {
        setMapDimensions({ width: img.width, height: img.height });
      };
    } catch (error) {
      console.error('Error fetching monitored map:', error);
    }
  };

  const fetchMapMetadata = async () => {
    const token = getToken();
    if (!token) return;

    try {
      const response = await axios.get('http://172.30.1.28:5557/map/monitored/metadata', {
        headers: { Authorization: `Bearer ${token}` },
      });
      const metadata = response.data;
      const resolution = parseFloat(metadata.match(/resolution:\s*(\d+.\d+)/)[1]);
      setMapResolution(resolution);
    } catch (error) {
      console.error('Error fetching map metadata:', error);
    }
  };

  const fetchAllTasks = async () => {
    console.log("Fetching all tasks (logs)");
    const token = getToken();
    if (!token) {
      console.log("No token found, exiting fetchAllTasks");
      return;
    }

    try {
      const response = await axios.get('http://172.30.1.28:8080/task/all', {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });
      setTasks(response.data); // 모든 작업 데이터를 상태로 설정
    } catch (error) {
      console.error('Error fetching tasks:', error);
    }
  };

  const fetchRobots = async () => {
    console.log("Fetching robots");
    const token = getToken();
    if (!token) {
      console.log("No token found, exiting fetchRobots");
      return;
    }

    try {
      const response = await axios.get('http://172.30.1.28:5559/robot/robots', {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });
      setRobots(response.data);
    } catch (error) {
      console.error('Error fetching robots:', error);
    }
  };

  const formatDate = (date) => {
    return date ? new Date(date).toLocaleString() : 'N/A';
  };

  return (
    <div style={{ fontFamily: 'Arial, sans-serif', margin: '20px', position: 'relative', minHeight: '100vh' }}>
      <header style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '20px' }}>
        <UserInfo />
        <LogoutButton />
      </header>
      <Navbar />
      <h2 style={{ textAlign: 'center', margin: '20px 0' }}>Monitoring Page</h2>
      <div style={{ display: 'flex', flexGrow: 1 }}>
        {/* Left side - Map canvas */}
        <div style={{ flex: 3, display: 'flex', justifyContent: 'center', alignItems: 'center', marginRight: '20px' }}>
          {mapUrl ? (
            <canvas
              ref={canvasRef}
              style={{ border: '1px solid #ccc', width: '100%', height: '80vh' }} // Ensure large size for map
            ></canvas>
          ) : (
            <p>Loading map...</p>
          )}
        </div>

        {/* Right side - Robot list */}
        <div style={{ flex: 1, padding: '20px', borderLeft: '1px solid #ccc', overflowY: 'auto', maxHeight: '80vh' }}>
          <h3>Robot List</h3>
          <ul style={{ listStyleType: 'none', padding: 0 }}>
            {robots.length > 0 ? (
              robots.map((robot) => (
                <li key={robot._id} style={{ marginBottom: '10px', borderBottom: '1px solid #ddd', padding: '10px' }}>
                  <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                    <span><strong>Name:</strong> {robot.name}</span>
                    <span><strong>State:</strong> {robot.status.state}</span>
                    <span><strong>Battery:</strong> {robot.status.battery}%</span>
                    <span><strong>IP:</strong> {robot.ip}</span>
                  </div>
                </li>
              ))
            ) : (
              <p>No robots connected.</p>
            )}
          </ul>
        </div>
      </div>

      {/* Task logs section fixed at the bottom */}
      <div style={{
        position: 'absolute',
        bottom: 0,
        left: 0,
        width: '100%',
        padding: '20px',
        borderTop: '1px solid #ccc',
        height: '20vh',
        overflowY: 'auto',
        backgroundColor: '#f9f9f9'
      }}>
        <h3>Task Logs</h3>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>Task Name</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>Robot IP</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>Task Type</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>Status</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>Start Time</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>End Time</th>
            </tr>
          </thead>
          <tbody>
            {tasks.length > 0 ? (
              tasks.map((task, index) => (
                <tr key={index}>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.name}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.robotIp}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.taskType}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.status}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{formatDate(task.startTime)}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{formatDate(task.endTime)}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" style={{ textAlign: 'center', padding: '10px' }}>No task logs available.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default TestPage;
